import React, { Component } from 'react'

import {Containe,Row,Col,Card,Button, Container} from 'react-bootstrap';

export default class reactboostrap extends Component {
 
  constructor(props) {
    super(props)
  
    this.state = {}
  }
  render() {


    return (<>
      <div className="container text-center p-5">
           <h1>REACT BOOSTRAP UI PACKAGE</h1>
         <Container>
              <Row>
                  <Col lg={4} md={4}>
                  </Col>
              </Row>
         </Container>
      
      </div>
      </>)
  }
}
